export const removeUserUtilits = (usersList, acion) => {
  console.log(state)
  console.log(usersList)

  const usersListAfterFilter = usersList.filter((user) => user._id !== acion.payload)
  console.log(usersListAfterFilter)

  return usersListAfterFilter 
}
